        function setBounds() {
            if (bounds_group.getLayers().length) {
                map.fitBounds(bounds_group.getBounds());
            }
            map.setMaxBounds(map.getBounds());
        }
        function pop_FONDO_LIN2_BLANC_0(feature, layer) {
        }

                dashArray: '',
                lineCap: 'square',
                lineJoin: 'bevel',
                weight: 5.0,
                fillOpacity: 0,
                interactive: false,
            }
        }
        map.createPane('pane_FONDO_LIN2_BLANC_0');
        map.getPane('pane_FONDO_LIN2_BLANC_0').style.zIndex = 400;
        map.getPane('pane_FONDO_LIN2_BLANC_0').style['mix-blend-mode'] = 'normal';

            dataVar: 'json_FONDO_LIN2_BLANC_0',
            layerName: 'layer_FONDO_LIN2_BLANC_0',
            pane: 'pane_FONDO_LIN2_BLANC_0',
            onEachFeature: pop_FONDO_LIN2_BLANC_0,
            style: style_FONDO_LIN2_BLANC_0_0,
